function showSearchProfiles(props) {
  return (
    <div className="w-50">
      <div className="row-profile-pic pt-2">
        <span className="h5 go-to-profile">{props.user.username}</span>

        <img
          src={props.picture}
          alt={props.user.username}
          className="profile-img-comment rounded-circle go-to-profile"
        />
      </div>
    </div>
  );
}

export { showSearchProfiles };
